import React from "react";

function Topseaction() {
  const data = [
    {
      name: "Earning",
      amount: "$198K",
      increment: "37.8% this month",
      class: "green",
    },
    {
      name: "Orders",
      amount: "$2.4K",
      increment: "2% this month",
      class: "blue",
    },
    {
      name: "Balence",
      amount: "$2.4K",
      increment: "2% this month",
      class: "aqua",
    },
    {
      name: "Total sale",
      amount: "$89K",
      increment: "11% this week",
      class: "pink",
    },
  ];
  return (
    <div className="roundee">
      {data.map((el) => (
        <div className="round">
          {" "}
          <p className={el.class}>1</p>{" "}
          <p className="small">
            <span>{el.name}</span>
            <span>{el.amount}</span>
            <span>{el.increment}</span>
          </p>
        </div>
      ))}
    </div>
  );
}

export default Topseaction;
